import React, { useState } from "react";
import Card from "../UI/Card";
import ExpenseItem from "./ExpenseItem";
import ExpensesFilter from "./ExpensesFilter";

import './Expenses.css';

function Expenses(props) {

    const [dropDSelection, setSelection] = useState('');

    const dropDownChangeHandler = (selection) => {

        setSelection(prevSelection => selection);

    }



    return (

        <Card className="expenses">
            <ExpensesFilter selected={dropDSelection} onDropDownChange={dropDownChangeHandler} />
            {props.expense.map((expense) =>
                // {if (dropDSelection == expense.date.toLocaleString(year, 'numeric'))
                <ExpenseItem
                    title={expense.title}
                    amount={expense.amount}
                    date={expense.date}>
                </ExpenseItem>)};
        </Card>

    );
}

export default Expenses;
